contracts/Airdrop.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.24;

import "./IERC20.sol";

contract Airdrop {

    IERC20 public tokenContract;
    address public owner;

    constructor(address _tokenContractAddress) {
        tokenContract = IERC20(_tokenContractAddress);
        owner = msg.sender;
    }

    function drop(address[] memory _to, uint256 _value) public {

        // Check if the caller is the owner
        require(msg.sender == owner, "Only the owner can airDrop tokens");

        // Check if there are enough tokens in the contract
        require(
            tokenContract.balanceOf(address(this)) >= _value * _to.length,
            "Not enough tokens in the contract"
        );

        // Transfer tokens to each address
        for (uint256 i = 0; i < _to.length; i++) {
            tokenContract.transfer(_to[i], _value);
        }
    }
}

contracts/Faucet.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.24;

import "./IERC20.sol";

contract Faucet {

    // Token contract
    IERC20 public tokenContract;

    // Record the time of the last withdrawal
    mapping(address => uint256) public receiveRecord;

    // Amount of tokens to be withdrawn each time
    uint256 public amountEachTime;

    // Contract owner
    address public owner;

    constructor(address _tokenContractAddress, uint256 _amountEachTime){
        tokenContract = IERC20(_tokenContractAddress);
        amountEachTime = _amountEachTime;
        owner = msg.sender;
    }

    // Withdraw tokens, each address can only withdraw once every 24 hours
    function withdraw() external {

        // Check if the address has withdrawn tokens
        if (receiveRecord[msg.sender] > 0) {
            require(
                receiveRecord[msg.sender] - block.timestamp > 24 hours,
                "You can only withdraw once a day"
            );
        }

        // Check if there are enough tokens in the contract
        require(
            tokenContract.balanceOf(address(this)) >= amountEachTime,
            "Not enough tokens in the contract"
        );

        // Update the withdrawal record and transfer the tokens
        receiveRecord[msg.sender] = block.timestamp;
        tokenContract.transfer(msg.sender, amountEachTime);
    }

    // Set the amount of tokens to be withdrawn each time, only the owner can call this function
    function setAmountEachTime(uint256 _amountEachTime) public {
        require(msg.sender == owner, "Only the owner can set the amount");
        amountEachTime = _amountEachTime; // 更新每次领取的数量
    }
}

contracts/HeraToken.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.24;

import "./IERC20.sol";

contract HeraToken is IERC20 {

    string private _name;
    string private _symbol;
    uint8 private _decimals;
    uint256 private _totalSupply;

    // Returns address token
    mapping(address => uint256) private _balances;

    //
    mapping(address => mapping(address => uint256)) private _allowance;

    // contract owner
    address public owner;

    constructor(
        string memory _initName,
        string memory _initSymbol,
        uint8 _initDecimals,
        uint256 _initTotalSupply
    ) {
        owner = msg.sender;
        _name = _initName;
        _symbol = _initSymbol;
        _decimals = _initDecimals;
        _totalSupply = _initTotalSupply;

        // Assign the total supply to the contract owner
        _balances[owner] = _initTotalSupply;
    }

    function name() external view override returns (string memory) {
        return _name;
    }

    function symbol() external view override returns (string memory) {
        return _symbol;
    }

    function decimals() external view override returns (uint8) {
        return _decimals;
    }

    function totalSupply() external view override returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address _owner) external view override returns (uint256 balance) {
        return _balances[_owner];
    }

    function transfer(address _to, uint256 _value) external override returns (bool success)  {

        require(_balances[msg.sender] >= _value, "Insufficient balance");
        _balances[msg.sender] -= _value;
        _balances[_to] += _value;
        emit Transfer(msg.sender, _to, _value);
        return true;
    }

    function transferFrom(address _from, address _to, uint256 _value) external override returns (bool success) {
        require (_balances[_from] >= _value, "Insufficient balance");

        // Check if the sender has enough allowance
        require (_allowance[_from][_to] >= _value, "Insufficient allowance");

        _balances[_from] -= _value;
        _balances[_to] += _value;
        _allowance[_from][_to] -= _value;
        emit Transfer(_from, _to, _value);
        return true;
    }

    function approve(address _spender, uint256 _value) external override returns (bool success) {

        // Set the allowance, the amount the spender can withdraw
        _allowance[msg.sender][_spender] = _value;
        emit Approval(msg.sender, _spender, _value);
        return true;
    }

    function allowance(address _owner, address _spender) external view override returns (uint256 remaining) {

        // Returns the amount which `_spender` is still allowed to withdraw from `_owner`.
        return _allowance[_owner][_spender];
    }
}

contracts/IERC20.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.24;

interface IERC20 {

    // Returns the name of the token
    function name() external view returns (string memory);

    // Returns the symbol of the token
    function symbol() external view returns (string memory);

    // The decimal places used for token representation,
    // where tokens are divided by this value for display to users.
    // It's also known as precision, typically set to 18.
    function decimals() external view returns (uint8);

    // Returns the total token supply.
    function totalSupply() external view returns (uint256);

    // Returns the account balance
    function balanceOf(address _owner) external view returns (uint256 balance);

    // Transfers `_value` amount of tokens to address `_to`, Must fire Transfer event.
    function transfer(address _to, uint256 _value)
    external
    returns (bool success);

    // Transfers `_value` amount of tokens from address `_from` to address `_to`, Must fire Transfer event.
    function transferFrom(
        address _from,
        address _to,
        uint256 _value
    ) external returns (bool success);

    // Allows `_spender` to withdraw from your account multiple times, up to the `_value` amount. Must fire Approval event.
    function approve(address _spender, uint256 _value)
    external
    returns (bool success);

    // Returns the amount which `_spender` is still allowed to withdraw from `_owner`.
    function allowance(address _owner, address _spender)
    external
    view
    returns (uint256 remaining);

    // Transfer event.
    event Transfer(address indexed _from, address indexed _to, uint256 _value);

    // Approval event.
    event Approval(
        address indexed _owner,
        address indexed _spender,
        uint256 _value
    );
}

